// src/pages/HomePage.js
import React from 'react';
import { Card } from 'primereact/card';
import { Button } from 'primereact/button';

const HomePage = () => {
  return (
    <div className="p-grid p-align-center p-justify-center" style={{ minHeight: '100vh', padding: '2rem' }}>
      <Card 
        title="Bienvenido a Almacén de Vinos" 
        subTitle="Gestión eficiente de bodegas"
        style={{ width: '25rem', marginBottom: '2em' }}
        footer={<Button label="Ver Vinos" className="p-button-secondary" />}
      >
        <p>Organiza y gestiona tus vinos de forma sencilla.</p>
      </Card>

      <Card 
        title="Administra tus Bodegas"
        style={{ width: '25rem', marginBottom: '2em' }}
        footer={<Button label="Ver Bodegas" className="p-button-secondary" />}
      >
        <p>Gestiona todas tus bodegas y optimiza el inventario.</p>
      </Card>
    </div>
  );
};

export default HomePage;
